import React from "react";
import { BrowserRouter as Router, Routes, Route, Outlet } from "react-router-dom";
import Header from "./components/common/header/Header";
import Footer from "./components/common/footer/Footer";
import Login from "./components/login/Login";  // Login page
import Signup from "./components/login/Signup";  // Your Signup Page

function App() {
  return (
    <Router>
      <Routes>
        {/* Login page without Header and Footer */}
        <Route path="/logins" element={<Login />} />

        {/* Other routes with Header and Footer */}
        <Route path="/" element={<LayoutWithHeaderFooter />}>
        </Route>
      </Routes>
    </Router>
  );
}

// Layout that includes Header and Footer for all other routes
function LayoutWithHeaderFooter() {
  return (
    <>
      <Header />
      <Outlet /> {/* Renders child route components */}
      <Footer />
    </>
  );
}

export default App;
